import {FETCH, DELETE,CREATE} from '../ActionTypes/tablelist'


const initialState = {
    data : '',
    dataSearch :null
};



export const  tablelistReducer = (state = initialState, action ) => {
    switch (action.type) {
        case FETCH:
            return {
                ...state,
                data : action.payload,
                dataSearch :action.payload,
            }
        case DELETE:
            let {data} = state;

            let data2 = data.filter(item => item.key !== action.payload)

            return {
                ...state,
                data:data2
            }

        case CREATE: {
            let {data} = state;
            return {
                ...state,
                data:action.payload
            }
         }

         default:
             return state;
    }
}
